import './App.css';
import Navbar from './components/Navbar';
import Mid from './components/Mid';
import Carousel from './components/Carousel';
import Form from './components/Form';
import Venue from './components/Venue';

function App() {
  return (
    <>
    <Navbar></Navbar>
    <Venue/>
    <Mid></Mid>
    <Carousel/>
    <Form/>
    </>
  );
}

export default App;
